import React, { useEffect } from 'react';
import gsap from 'gsap';
import 'ionicons';

import './IntroAnimationStyles.css';

const preloadImages = () => {
    const images = document.querySelectorAll('img');
    return Promise.all(
        Array.from(images).map((img) => {
            return new Promise((resolve) => {
                if (img.complete) {
                    resolve();
                } else {
                    img.onload = resolve;
                    img.onerror = resolve;
                }
            });
        })
    );
};

const IntroAnimation = () => {
    useEffect(() => {
        preloadImages().then(() => {
            let tl = gsap.timeline({ delay: 0 });
            tl.to(".col", {
                top: 0,
                duration: 3,
                ease: "power4.inOut"
            })
                .to(".c-1 .item", {
                    top: 0,
                    stagger: 0.25,
                    duration: 3,
                    ease: "power4.inOut"
                }, "-=2")
                .to(".c-2 .item", {
                    top: 0,
                    stagger: -0.25,
                    duration: 3,
                    ease: "power4.inOut"
                }, "-=4")
                .to(".c-3 .item", {
                    top: 0,
                    stagger: 0.25,
                    duration: 3,
                    ease: "power4.inOut"
                }, "-=4")
                .to(".c-4 .item", {
                    top: 0,
                    stagger: -0.25,
                    duration: 3,
                    ease: "power4.inOut"
                }, "-=4")
                .to(".c-5 .item", {
                    top: 0,
                    stagger: 0.25,
                    duration: 3,
                    ease: "power4.inOut"
                }, "-=4")
                .to(".container", {
                    scale: 6,
                    duration: 4,
                    ease: "power4.inOut"
                }, "-=2")
                .to(".nav-item a, .title p, .slide-num p, .preview img", {
                    top: 0,
                    stagger: 0.075,
                    duration: 1,
                    ease: "power3.out"
                }, "-=1.5")
                .to(".icon ion-icon, .icon-2 ion-icon", {
                    scale: 1,
                    stagger: 0.05,
                    ease: "power3.out"
                }, "-=1");
        });
    }, []);

    return (
        <div className="container">
            {Array(5).fill().map((_, colIdx) => (
                <div key={colIdx} className={`col c-${colIdx + 1}`}>
                    {Array(5).fill().map((_, itemIdx) => (
                        <div key={itemIdx} className="item">
                            <img src={`../../../public/images/${(colIdx * 5) + itemIdx + 1}.jpg`} alt="" loading="lazy" />
                        </div>
                    ))}
                </div>
            ))}
            <div className="content">
                <nav>
                    <div className="nav-item">
                        <a href="#" id="active">Projects</a>
                    </div>
                    <div className="nav-item">
                        <a href="#">Contact</a>
                    </div>
                </nav>
                <div className="hero">
                    <div className="icon"><ion-icon name="add-sharp"></ion-icon></div>
                    <div className="title"><p>Svens Portfolio</p></div>
                    <div className="icon-2"><ion-icon name="add-sharp"></ion-icon></div>
                </div>
                <footer>
                    <div className="preview">
                        {Array(7).fill().map((_, previewIdx) => (
                            <img key={previewIdx} src={`../../../public/images/${previewIdx + 1}.jpg`} alt="" loading="lazy" />
                        ))}
                    </div>
                    <div className="slide-num"><p>1 &mdash; 3</p></div>
                </footer>
            </div>
        </div>
    );
};

export default IntroAnimation;
